import React from 'react';

function Contact() {
  return React.createElement(
    'div',
    { className: 'p-8 text-center' },
    React.createElement('h2', { className: 'text-2xl font-bold mb-4' }, 'Contact Me'),
    React.createElement('p', null, 'Email: your.email@example.com'),
    React.createElement('p', null, 'GitHub: github.com/yourusername'),
    React.createElement('p', null, 'LinkedIn: linkedin.com/in/yourusername')
  );
}

export default Contact;
